    id: number | null;
    productName: string;
    productCode: string;
    description: string;
    starRating: number;
}

import { createReducer, on, createFeatureSelector, createSelector } from '@ngrx/store';
import { Product } from '../product';
import * as AppState from '../../state/app.state';

import * as ProductActions from './product.action';

export interface State extends AppState.State {
    products: ProductState;
}

export interface ProductState {
    showProductCode: boolean;
    currentProductId: number;
    products: Product[];
    error: string;
}

const initialState: ProductState = {
    showProductCode: true,
    currentProductId: null,
    products: [],
    error: ''
}

const getProductFeatureState = createFeatureSelector<ProductState>('products');

export const getShowProductCode = createSelector(getProductFeatureState, state => state.showProductCode);

export const getCurrentProductId = createSelector(getProductFeatureState, state => state.currentProductId);

export const getCurrentProduct = createSelector(
    getProductFeatureState,
    getCurrentProductId,
    (state, currentProductId) => {
        if(currentProductId === 0) {
            return {
                id: 0,
                productName: '',
                productCode: 'New',
                description: '',
                starRating: 0
            }
        } else {
            return currentProductId ? state.products.find(f=> f.id === currentProductId) : null;
        }
    }
);

export const getProducts = createSelector(getProductFeatureState, state => state.products);

export const getError = createSelector(getProductFeatureState, state => state.error);

export const productReducer = createReducer<ProductState>(
    initialState,
    on(ProductActions.toggleProductCode, (state): ProductState => {
        return {
            ...state,
            showProductCode: !state.showProductCode
        };
    }),
    on(ProductActions.setCurrentProduct, (state, action): ProductState => {
        return {
            ...state,
            currentProductId: action.currentProductId
        }
    }),
    on(ProductActions.clearCurrentProduct, (state): ProductState => {
        return {
            ...state,
            currentProductId: null
        }
    }),
    on(ProductActions.initializeCurrentProduct, (state): ProductState => {
        return {
            ...state,
            currentProductId: 0
        }
    }),
    on(ProductActions.loadProductsSuccess, (state, action): ProductState => {
        return {
            ...state,
            products: action.products,
            error: ''
        }
    }),
    on(ProductActions.loadProductsFaliure, (state, action): ProductState => {
        return {
            ...state,
            error: action.error
        }
    }),
    on(ProductActions.updateProductSuccess, (state, action): ProductState => {
        const updatedProducts = state.products.map(
          item => action.product.id === item.id ? action.product : item);
        return {
          ...state,
          products: updatedProducts,
          currentProductId: action.product.id,
          error: ''
        };
      }),
      on(ProductActions.updateProductFailure, (state, action): ProductState => {
        return {
          ...state,
          error: action.error
        };
      }),
      // After a create, the currentProduct is the new product.
      on(ProductActions.createProductSuccess, (state, action): ProductState => {
        return {
          ...state,
          products: [...state.products, action.product],
          currentProductId: action.product.id,
          error: ''
        };
      }),
      on(ProductActions.createProductFailure, (state, action): ProductState => {
        return {
          ...state,
          error: action.error
        };
      }),
      // After a delete, the currentProduct is null.
      on(ProductActions.deleteProductSuccess, (state, action): ProductState => {
        return {
          ...state,
          products: state.products.filter(product => product.id !== action.productId),
          currentProductId: null,
          error: ''
        };
      }),
      on(ProductActions.deleteProductFailure, (state, action): ProductState => {
        return {
          ...state,
          error: action.error
        };
      })
);

